	inline constexpr detail::GraphemeType GraphemeHigh(char32_t cp) {
		size_t left = 0, right = 256;
		while (left < right) {
			size_t center = (right - left) / 2;
			if (cp < detail::GraphemeHighStart[center])
				right = center - 1;
			else
				left = center;
		}
		if (cp - detail::GraphemeHighStart[left] > detail::GraphemeHighSize[left])
			return detail::GraphemeType::other;
		return static_cast<detail::GraphemeType>(detail::GraphemeHighValue[left]);
	}
	inline constexpr detail::GraphemeType LookupGraphemeType(char32_t cp) {
		if (cp < 0x80)
			return detail::GraphemeAscii(cp);
		if (cp < 0x10000)
			return detail::GraphemeLow(cp);
		return detail::GraphemeHigh(cp);
	}
